import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { useOrder } from '../context/OrderContext';
import BackButton from '../components/BackButton';

const Profile = () => {
  const { user, logout } = useAuth();
  const { orderHistory } = useOrder();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  const recentOrders = orderHistory.slice(0, 3);
  const totalOrders = orderHistory.length;
  const totalSpent = orderHistory.reduce(
    (sum, order) => sum + (order.total || 0),
    0
  );

  const memberSince = user?.createdAt
    ? new Date(user.createdAt).getFullYear()
    : 'New';

  const formatOrderId = (order) =>
    order.orderId || order.id || order._id;

  const formatOrderDate = (order) => {
    const d = order.date || order.orderDate || order.createdAt;
    if (!d) return 'Date not available';
    return new Date(d).toLocaleDateString('en-GB');
  };

  return (
    <div className="profile-page">
      <BackButton />
      <div className="container">
        <div className="profile-container">
          <div className="profile-sidebar">
            <div className="profile-avatar">ðŸ‘¤</div>
            <div className="profile-name">
              {user?.name || 'Guest User'}
            </div>
            <button className="btn btn-logout" onClick={handleLogout}>
              Logout
            </button>

            <div className="profile-info">
              <div className="profile-info-item">
                <span>ðŸ“§</span>
                <span>{user?.email || 'N/A'}</span>
              </div>
              <div className="profile-info-item">
                <span>ðŸ“ž</span>
                <span>{user?.phone || 'N/A'}</span>
              </div>
            </div>
          </div>

          <div className="profile-content">
            <div className="profile-section">
              <h3>
                <span>ðŸ“Š</span> Statistics
              </h3>
              <div className="stats-grid">
                <div className="stat-item">
                  <div className="stat-label">Total Orders</div>
                  <div className="stat-value">{totalOrders}</div>
                </div>
                <div className="stat-item">
                  <div className="stat-label">Total Spent</div>
                  <div className="stat-value">
                    à§³{totalSpent.toFixed(2)}
                  </div>
                </div>
                <div className="stat-item">
                  <div className="stat-label">Member Since</div>
                  <div className="stat-value">{memberSince}</div>
                </div>
              </div>
            </div>

            <div className="profile-section">
              <h3>
                <span>ðŸ“¦</span> Recent Orders
              </h3>
              <div className="order-list">
                {recentOrders.length === 0 ? (
                  <p
                    style={{
                      color: 'var(--text-gray)',
                      textAlign: 'center',
                    }}
                  >
                    No orders yet. Start ordering now!
                  </p>
                ) : (
                  recentOrders.map((order) => {
                    const id = formatOrderId(order);
                    return (
                      <div key={id} className="order-item">
                        <div className="order-header">
                          <span className="order-id">
                            Order {id}
                          </span>
                          <span className="order-status delivered">
                            {order.status}
                          </span>
                        </div>
                        <div className="order-date">
                          {formatOrderDate(order)}
                        </div>
                        <div className="order-items">
                          {(order.items || [])
                            .map((item) => item.name)
                            .join(', ')}
                        </div>
                        <div className="order-footer">
                          <span className="order-total">
                            à§³{order.total}
                          </span>
                          <button
                            className="btn-view-details"
                            onClick={() =>
                              navigate(
                                `/order-details/${id}`
                              )
                            }
                          >
                            View Details
                          </button>
                        </div>
                      </div>
                    );
                  })
                )}
              </div>
              {totalOrders > 3 && (
                <button
                  className="btn-view-all"
                  onClick={() => navigate('/order-history')}
                >
                  View All Orders
                </button>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
